import React from 'react';
import Head from "next/head";
import { Layout } from "../components";
import fetch from 'isomorphic-unfetch'

/**
 *
 * @param articles
 * @returns {*}
 * @constructor
 */
const HomePage = (articles) => {
  return (
    <Layout>
      <Head>
        <title>Welcome</title>
      </Head>

      <section className="section">
        <div className="columns is-multiline">
        {Object.keys(articles).map((article, key) => {
          const {
            urlToImage,
            author,
            publishedAt,
            title,
            description
          } = articles[article];

          return (
              <div className={ key === 0 || key === 3 ? 'column is-two-thirds' : 'column'}>
                { key === 0 &&
                  <div className='columns'>
                    <div className='is-half hero hero--custom'>
                      <div className='hero-body'>
                        <div className='container'>
                          <div className='title'>
                            {title}
                          </div>
                        </div>
                      </div>
                      <h3><strong>{title}</strong></h3>
                      <p>{description}</p>
                    </div>
                    <div className='hero--custom'>
                      <img src={urlToImage} alt={title} />
                    </div>
                  </div>
                }
                { key >= 1 &&
                  <div>{description}</div>
                }
              </div>


          )
        })}
        </div>
    </section>
    </Layout>
  )
};


HomePage.getInitialProps = async () => {
  try {
    const res = await fetch('https://newsapi.org/v2/top-headlines?country=us&apiKey=d6fd84244a5240e49fbabded8f5ac2b3&pageSize=3');
    const { status, articles } = await res.json();

    if (status === 'ok') {
      return articles;
    }
    return {};
  } catch (e) {
    console.log(e);
    return {};
  }
};

export default HomePage
